(1, 1, '2017-02-22 13:04:33', '2017-02-22 10:04:33', 'Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите её, затем пишите!', 'Привет, мир!', '', 'publish', 'open', 'open', '', 'privet-mir', '', '', '2017-02-22 13:04:33', '2017-02-22 10:04:33', '', 0, 'http://agroturbo-wp/?p=1', 0, 'post', '', 1),
(2, 1, '2017-02-22 13:04:33', '2017-02-22 10:04:33', 'Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\r\n\r\n<blockquote>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\r\n\r\n...или так:\r\n\r\n<blockquote>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\r\n\r\nПерейдите <a href=\"http://agroturbo-wp/wp-admin/\">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!', 'Пример страницы', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2017-02-22 13:04:33', '2017-02-22 10:04:33', '', 0, 'http://agroturbo-wp/?page_id=2', 0, 'page', '', 0),
