(9, 1, '2017-02-22 16:00:16', '2017-02-22 13:00:16', '[gallery ids=\"10,11,12,13\"]\r\n\r\n<strong>Турбина</strong> К27-541-01 (CZ)  ТКР К27-542-01 (CZ) Д260.4S2 Евро-2  МТЗ\r\n\r\n<strong>Модель</strong>: ТКР К27-541-01\r\n\r\n<strong>Каталожный номер</strong>: 541-01\r\n\r\n<strong>Техника</strong>: МТЗ-2022  ХТЗ-17221-19  Трактор МТЗ 2022.3  МТЗ 2022В.3\r\n\r\n<strong>Двигатель</strong>: Д260.4S2 Евро-2\r\n\r\n<strong>Аналог</strong>:<a href=\"http://agroturbo.prom.ua/site_search?search_term=%D0%A2%D0%9A%D0%A0+7.1-00.03+%28%D0%91%D0%97%D0%90%29\" target=\"_self\"><u> ТКР 7.1-00.03 (БЗА)</u></a>\r\n\r\n<!--more--><!--noteaser-->\r\n\r\n<img class=\"aligncenter\" src=\"https://images.ua.prom.st/329431570_w640_h2048_33911926_w640_h640_37.jpg?PIMAGE_ID=329431570\" alt=\"\" />\r\n\r\n<span class=\"b-title\">Характеристики</span>\r\n<div class=\"b-content__body\">\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Оригинал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-2\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">CZ Strakonice</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Польша</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-4\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">12 мес</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс. сопротивление впускного тракта перед компрессором</td>\r\n<td class=\"b-product-info__cell\">4-6</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс. подача воздуха</td>\r\n<td class=\"b-product-info__cell\">0.26 кг/с-1</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диапазон рабоч. числа оборотов,</td>\r\n<td class=\"b-product-info__cell\">30 000 - 120 000</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Рабочее давление,</td>\r\n<td class=\"b-product-info__cell\">200-600</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс. допустимая темп-ра выхлопных газов,</td>\r\n<td class=\"b-product-info__cell\">700 °С</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс. сопротивление выпускного трубопровода за турбиной</td>\r\n<td class=\"b-product-info__cell\">5-6</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объем для заливания масла перед установкой,</td>\r\n<td class=\"b-product-info__cell\">0.05 л</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Технические характеристики</td>\r\n<td class=\"b-product-info__cell\">К27-551-01 (CZ)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс. степень сжатия компрессора</td>\r\n<td class=\"b-product-info__cell\">2.9</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', 'Турбина К27-541-01 (CZ) ТКР К27-542-01 (CZ) Д260.4S2 Евро-2 МТЗ ХТЗ-17221-19', '', 'publish', 'open', 'open', '', 'turbina-k27-541-01-cz-tkr-k27-542-01-cz-d260-4s2-euro-2-mtz-xtz-17221-19', '', '', '2017-03-03 02:26:06', '2017-03-02 23:26:06', '', 0, 'http://agroturbo-wp/?p=9', 0, 'post', '', 0),
