ловый ТКР-14 с26.\r\n\r\nПланка стопорная ТКР-14 741093\r\n\r\nГайка ротора ТКР-14 718500.\r\n\r\nКольцо уплотнительное ТКР -14 С – 509199.\r\n\r\nКорпус подшипников ТКР-14 Б-718020.\r\n\r\nРотор ТКР ― 14 н 718496-06.\r\n\r\nРотор ТКР ― 14 С 741117.\r\n\r\nШайба специальная ТКР-14 718501.\r\n\r\n<img src=\"https://images.ua.prom.st/203149830_w640_h2048_img_1057.jpg?PIMAGE_ID=203149830\" alt=\"\" />\r\n\r\n<img src=\"https://images.ua.prom.st/203150698_w640_h2048_img_1059.jpg?PIMAGE_ID=203150698\" alt=\"\" />\r\n\r\n<img src=\"https://images.ua.prom.st/203154515_w640_h2048_s51774474.jpg?PIMAGE_ID=203154515\" alt=\"\" />\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-0\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">Дальдизель</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Россия</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-2\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">12(мес)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип топлива</td>\r\n<td class=\"b-product-info__cell\">Дизельное</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Номинальный базовый диаметр компрессора, мм</td>\r\n<td class=\"b-product-info__cell\">140</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Температура газов перед турбиной, К (С): при длительной работе</td>\r\n<td class=\"b-product-info__cell\">925(652)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Температура газов перед турбиной, К (С): максимальная часовая</td>\r\n<td class=\"b-product-info__cell\">975(702)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Степень повышения давления</td>\r\n<td class=\"b-product-info__cell\">1,55±0,05</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Подача компрессора, кг/с, не менее</td>\r\n<td class=\"b-product-info__cell\">0,33</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">КПД: компрессора</td>\r\n<td class=\"b-product-info__cell\">0,75</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">КПД: турбины</td>\r\n<td class=\"b-product-info__cell\">0,74</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Масса, кг (не более)</td>\r\n<td class=\"b-product-info__cell\">35</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Габаритные размеры, мм:</td>\r\n<td class=\"b-product-info__cell\">0</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">длина</td>\r\n<td class=\"b-product-info__cell\">350</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">ширина</td>\r\n<td class=\"b-product-info__cell\">350</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">высота</td>\r\n<td class=\"b-product-info__cell\">470</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Срок службы подшипника, тыс. ч</td>\r\n<td class=\"b-product-info__cell\">10</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'Турбина ТКР-14Н9А21 6ЧН 18/22 Хабаровец', '', 'inherit', 'closed', 'closed', '', '449-revision-v1', '', '', '2017-03-06 16:42:58', '2017-03-06 13:42:58', '', 449, 'http://agroturbo-wp/449-revision-v1/', 0, 'revision', '', 0),
(458, 1, '2017-03-06 16:58:40', '2017-03-06 13:58:40', '<h2><img class=\"alignnone size-medium wp-image-459\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-460\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-461\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/333-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-462\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-463\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33333-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-464\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/333333-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-465\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333333-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-466\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33333333-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n<h2>Турбина «Скиф» ТКР 8.5Н3</h2>\r\n&nbsp;\r\n\r\nНадежная турбина, изготовленная на собственных производственных мощностях. Подходит для комбайнов «НИВА» СК-5, «ДОН-1200», «Сибиряк» СКД-6, а также для гусеничных тракторов ТБ-1М и ЛХТ-100. Торговым организациям возможно предоставление скидки до 10%.\r\n\r\n<!--more--><!--noteaser-->\r\n\r\n&nbsp;\r\n<h2>4 основных достоинств данного турбокомпрессора</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Качество</h3>\r\nСобственное современное производство позволяет гарантировать достойный уровень нашей продукции. Гарантийный срок — 12 месяцев.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Цена</h3>\r\nЛучшие на украинском рынке цены обусловлены производством в нашей стране и отсутствию посредников при продаже.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Износостойкость</h3>\r\nДля спецтехники очень важна возможность длительной, бесперебойной работы. Наши турбокомпрессоры способны выдерживать сложнейшие нагрузки!</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Производительность</h3>\r\nСовременные турбины позволяют заметно повысить мощность двигателя вашей техники, что, несомненно, приведет к увеличению ее продуктивности.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490097120_w640_h2048_137388997_w640__48_691.750.jpg?PIMAGE_ID=490097120\" /></div>\r\n</div>\r\n&nbsp;\r\n<h2>Модель: ТКР 8,5Н3 применяется в следующей технике</h2>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td>Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● СМД-21\r\n● СМД-22\r\n● СМД-22А\r\n● СМД-23\r\n● СМД-24\r\n● СМД-18 НП.01</td>\r\n<td>  ● 853.30001.00</td>\r\n<td>  ● Комбайн \"НИВА\"СК-5\r\n\r\n● Комбайн \"Сибиряк\" СКД-6\r\n\r\n● Комбайн \"ДОН-1200\"\r\n\r\n● Комбайн РКМ-4/5\r\n\r\n● Тракторр ТБ-1М\r\n\r\n● ЛХТ-100</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>4 причины выбрать интернет-магазин «Agroturbo»</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Мы работаем для вас по всей Украине. Доставка по стране осуществляется всего за 1-3 дня.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Мы бесплатно отправляем товар наложенным платежом, чтобы у вас была возможность осмотреть его перед оплатой.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Наличие больших объемов продукции на складе позволяет оперативно поставлять турбины клиентам.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Множество довольных отзывов от наших покупателей со всей страны.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490097727_w640_h2048_137389047_w640__48_692.750.jpg?PIMAGE_ID=490097727\" /></div>\r\n<div>\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Модель</td>\r\n<td class=\"b-product-info__cell\">СК-5</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление турбины</td>\r\n<td class=\"b-product-info__cell\">1(бар)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Сельскохозяйственная техника</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Оригинал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-5\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">Скиф</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Украина</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-7\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">12(мес)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип топлива</td>\r\n<td class=\"b-product-info__cell\">Дизельное</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Техническая характеристика</td>\r\n<td class=\"b-product-info__cell\">ТКР 8,5H3</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диаметр колеса компрессора, мм:</td>\r\n<td class=\"b-product-info__cell\">57/85</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диаметр колеса турбины, мм:</td>\r\n<td class=\"b-product-info__cell\">62/76</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Частота вращ. вала ротора, об/мин:</td>\r\n<td class=\"b-product-info__cell\">56 000</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс степень повыш. давления:</td>\r\n<td class=\"b-product-info__cell\">1,74-1,93</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление наддува, бар:</td>\r\n<td class=\"b-product-info__cell\">0,74-0,95</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производительность, кг/с:</td>\r\n<td class=\"b-product-info__cell\">0,13</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Масса, кг:</td>\r\n<td class=\"b-product-info__cell\">9,8</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n&nbsp;', 'Турбина ТКР 8,5Н3 Комбайн \"НИВА\"СК-5', '', 'publish', 'open', 'open', '', 'turbina-tkr-8-5n3-kombajn-niva-sk-5', '', '', '2017-03-07 15:18:56', '2017-03-07 12:18:56', '', 0, 'http://agroturbo-wp/?p=458', 0, 'post', '', 0),
