\r\nСобственное современное производство позволяет гарантировать достойный уровень нашей продукции. Гарантийный срок — 12 месяцев.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Цена</h3>\r\nЛучшие на украинском рынке цены обусловлены производством в нашей стране и отсутствию посредников при продаже.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Износостойкость</h3>\r\nДля спецтехники очень важна возможность длительной, бесперебойной работы. Наши турбокомпрессоры способны выдерживать сложнейшие нагрузки!</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Производительность</h3>\r\nСовременные турбины позволяют заметно повысить мощность двигателя вашей техники, что, несомненно, приведет к увеличению ее продуктивности.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490097120_w640_h2048_137388997_w640__48_691.750.jpg?PIMAGE_ID=490097120\" /></div>\r\n</div>\r\n&nbsp;\r\n<h2>Модель: ТКР 8,5Н3 применяется в следующей технике</h2>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td>Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● СМД-21\r\n● СМД-22\r\n● СМД-22А\r\n● СМД-23\r\n● СМД-24\r\n● СМД-18 НП.01</td>\r\n<td>  ● 853.30001.00</td>\r\n<td>  ● Комбайн \"НИВА\"СК-5\r\n\r\n● Комбайн \"Сибиряк\" СКД-6\r\n\r\n● Комбайн \"ДОН-1200\"\r\n\r\n● Комбайн РКМ-4/5\r\n\r\n● Тракторр ТБ-1М\r\n\r\n● ЛХТ-100</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>4 причины выбрать интернет-магазин «Agroturbo»</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID