(505, 1, '2017-03-06 17:42:34', '2017-03-06 14:42:34', '<h2>  <img class=\"alignnone size-medium wp-image-499\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/4-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-500\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/44-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-501\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/444-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-502\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/4444-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-503\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/44444-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-504\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/44444444-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-495\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333333-2-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-494\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33333-5-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-493\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n<h2>Турбина  ТКР 6-00.02</h2>\r\n&nbsp;\r\n\r\nСовременный турбокомпрессор для автомобилей ЗИЛ 4331 и ЗИЛ 5301, больше известного как «Бычок». Произведен на собственных мощностях, аналог чешской турбины С14-127-01. Официальная гарантия. Скидки для оптовых покупателей и торговых организаций.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Некоторые преимущества данной модели</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Комплектация</h3>\r\nТурбина поставляется в надежной упаковке с гарантийным паспортом, инструкцией и комплектом прокладок для установки.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Долговечность</h3>\r\nВы можете быть уверены в долгой и стабильной службе нашего турбокомпрессора. При производстве использовался только качественный металл.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Надежность</h3>\r\nЕсли вы обнаружите какой-либо дефект у турбины, мы гарантированно заменим ее. Гарантия на данную модель — 1 год.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Цена</h3>\r\nСобственное производство и большой запас продукции на складе позволяет устанавливать минимальную стоимость на надежные турбокомпрессоры.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/489851052_w640_h2048_137150613_w640__632_medium.jpg?PIMAGE_ID=489851052\" /></div>\r\n</div>\r\n&nbsp;\r\n<h2>Модель: ТКР 6-00.02 , ТКР 6 применяется в следующей технике</h2>\r\n&nbsp;\r\n<h2></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td>Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● Д245.12С-143/231/365/368</td>\r\n<td>&nbsp;\r\n\r\n● 600-1118010.02</td>\r\n<td>\r\n● ЗИЛ-4331\r\n\r\n● ЗиЛ 5301 \"Бычок\"</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Несколько причин, почему покупатели выбирают наш сайт</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Наличие собственных производственных мощностей с более чем 20-летним опытом работы.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Оперативное и профессиональное обслуживание каждого клиента. Компетентные консультации от экспертов.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Возможность разных способов оплаты, в том числе и после осмотра заказа в почтовом отделении.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Бесплатная доставка турбокомпрессоров по всей территории Украины.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&nbsp;\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Марка</td>\r\n<td class=\"b-product-info__cell\">ЗИЛ</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Модель</td>\r\n<td class=\"b-product-info__cell\">5301-Бычок</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление турбины</td>\r\n<td class=\"b-product-info__cell\">1(бар)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Грузовой автомобиль</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объем двигателя <span id=\"product-attribute-0-4\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">4750.0(куб. см)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Оригинал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состоян