(517, 1, '2017-03-06 18:02:33', '2017-03-06 15:02:33', '<h2><img class=\"alignnone size-medium wp-image-518\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2-8-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-519\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-520\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/222-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-521\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2222-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-522\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222-6-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" />  <img class=\"alignnone size-medium wp-image-524\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222222-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-525\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222222222-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n<h2>Турбина ТКР 7Н1</h2>\r\n&nbsp;\r\n\r\nНаша компания предлагает надежный, высокоэффективный турбокомпрессор собственного производства для автомобилей КамАЗ. Качество нашей продукции проверено многими автомобилистами со всей страны и подкреплено гарантийным талоном сроком 1 год.\r\n<!--more--><!--noteaser-->\r\n<h2>4 основных достоинств данного турбокомпрессора</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Выгодная цена на турбину достойного качества благодаря продаже без посредников.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\