(526, 1, '2017-03-06 18:02:33', '2017-03-06 15:02:33', '<h2><img class=\"alignnone size-medium wp-image-518\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2-8-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-519\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-520\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/222-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-521\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2222-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-522\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222-6-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" />  <img class=\"alignnone size-medium wp-image-524\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222222-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-525\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222222222-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n<h2>Турбина ТКР 7Н1</h2>\r\n&nbsp;\r\n\r\nНаша компания предлагает надежный, высокоэффективный турбокомпрессор собственного производства для автомобилей КамАЗ. Качество нашей продукции проверено многими автомобилистами со всей страны и подкреплено гарантийным талоном сроком 1 год.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>4 основных достоинств данного турбокомпрессора</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Выгодная цена на турбину достойного качества благодаря продаже без посредников.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Современные производственные мощности на территории Украины и использование высококачественных материалов.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Наличие сертификатов качества, а также 12 месяцев гарантийного обслуживания клиентов.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Удобный комплект поставки, с инструкцией и прокладками, позволяющий самостоятельно установить турбокомпрессор.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490083991_w640_h2048_137368476_w640__48_700.750.jpg?PIMAGE_ID=490083991\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Модель:  ТКР 7н1 (левый и правый) применяется в следующей технике</h2>\r\n<h2></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td> Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● КамАЗ 7403.10\r\n● КамАЗ 740.11-240</td>\r\n<td>  ● 7403-1118.010</td>\r\n<td>\r\n● Автомобили КамАЗ\r\n\r\n● БТР-80</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Преимущества нашей компании</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Работаем на рынке Украины с 1995 года. Примерно 20% наших заказчиков становятся постоянными клиентами.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Оперативно обрабатываем заявки и отправляем товар благодаря его постоянному наличию на наших складах.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>С нами, у вас есть возможность оплатить товар после осмотра. При обнаружении брака, мы оперативно заменим турбину.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Бесплатно отправляем все заказы в любую точку Украины.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490084849_w640_h2048_137368467_w640_h2048_bmw.jpg?PIMAGE_ID=490084849\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Грузовой автомобиль</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Оригинал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-3\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">Скиф</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Украина</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-5\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">12(мес)</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Техническая характеристика</td>\r\n<td class=\"b-product-info__cell\">ТКР 7Н1</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диаметр колеса компрессора, мм:</td>\r\n<td class=\"b-product-info__cell\">48/74</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диаметр колеса турбины, мм:</td>\r\n<td class=\"b-product-info__cell\">63/76</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Частота вращ. вала ротора, об/мин:</td>\r\n<td class=\"b-product-info__cell\">80 000</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс степень повыш. давления:</td>\r\n<td class=\"b-product-info__cell\">1,63</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление наддува, бар:</td>\r\n<td class=\"b-product-info__cell\">0,64</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производительность, кг/с:</td>\r\n<td class=\"b-product-info__cell\">0,12</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Масса, кг:</td>\r\n<td class=\"b-product-info__cell\">8,3</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'Турбина ТКР 7Н1 / АВТОМОБИЛЬ КАМАЗ 53212 / 54112', '', 'inherit', 'closed', 'closed', '', '517-revision-v1', '', '', '2017-03-06 18:02:33', '2017-03-06 15:02:33', '', 517, 'http://agroturbo-wp/517-revision-v1/', 0, 'revision', '', 0);
