(527, 1, '2017-03-06 18:09:06', '2017-03-06 15:09:06', '<h2><img class=\"alignnone size-medium wp-image-528\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3-6-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-529\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33-6-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-530\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/333-5-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-531\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333-5-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-532\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33333-6-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-533\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333333-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-534\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33333333-2-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n<h2>Турбина  7Н2А</h2>\r\n&nbsp;\r\n\r\nОтличным решением для замены изжившей себя турбины в автомобилях ЗИЛ 4331, ЗИЛ 5301, а также на тракторе МТЗ-100 и автобусе ЛАЗ 695 станет надежная и высокоэффективная турбина нашего производства — «Скиф» 7Н2А. Ее качество подтверждено официальной гарантией. Оптовым заказчикам предусмотрены скидки.\r\n<!--more--><!--noteaser-->\r\n&nbsp;\r\n<h2>Несколько особенностей данной турбины</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Качество — турбокомпрессор изготовлен на современном производственном оборудовании с применением сырья высочайшего уровня.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Устойчивость — наши турбины идеально выдерживают высокие и постоянные нагрузки.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Продуктивность — новейшее оборудование позволяет нам изготавливать турбины с большим КПД, чем стандартные, установленные на вашей технике.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Стоимость — благодаря собственному производству из украинских материалов и отсутствию всяческих посредников, мы имеем возможность предлагать доступную цену на наши турбины.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490088188_w640_h2048_137374642_w640__48_926.750.jpg?PIMAGE_ID=490088188\" /></div>\r\n</div>\r\n&nbsp;\r\n<h2>Модель: ТКР 7Н2А применяется в следующей технике</h2>\r\n<h2></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td>Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● Д-245\r\n● Д-245.1\r\n● РМ-80</td>\r\n<td>  ● 702-1118.010</td>\r\n<td>● ЗИЛ 4331● Автобус ЛАЗ 695\r\n\r\n● Тр-р МТЗ-100\r\n\r\n● ЗИЛ 5301</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Почему стоит сделать заказ именно у нас?</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Мы — производитель надежных турбокомпрессоров «Скиф» с 1995 года.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Выгодные условия сотрудничества для оптовиков и торговых компаний.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Отправляем заказы по Украине наложенным платежом за свой счет.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Заменим товар, если он вам не подошел или вы обнаружили брак.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490088675_w640_h2048_137374678_w640__48_927.750.jpg?PIMAGE_ID=490088675\" /></div>\r\n</div>\r\n<div>\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Оригинал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-2\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">Скиф</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Украина</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-4\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">12(мес)</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Техническая характеристика</td>\r\n<td class=\"b-product-info__cell\">ТКР 7Н2</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диаметр колеса компрессора, мм:</td>\r\n<td class=\"b-product-info__cell\">49/76</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диаметр колеса турбины, мм:</td>\r\n<td class=\"b-product-info__cell\">63/76</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Частота вращ. вала ротора, об/мин:</td>\r\n<td class=\"b-product-info__cell\">80 000-100 000</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс степень повыш. давления:</td>\r\n<td class=\"b-product-info__cell\">1,63</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление наддува, бар:</td>\r\n<td class=\"b-product-info__cell\">0,64</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производительность, кг/с:</td>\r\n<td class=\"b-product-info__cell\">0,12</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Масса, кг:</td>\r\n<td class=\"b-product-info__cell\">7,9</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', 'Турбина ТКР 7Н2А МТЗ -100 / ЗИЛ 4331', '', 'publish', 'open', 'open', '', 'turbina-tkr-7n2a-mtz-100-zil-4331', '', '', '2017-03-07 18:17:48', '2017-03-07 15:17:48', '', 0, 'http://agroturbo-wp/?p=527', 0, 'post', '', 0),
