-v1/', 0, 'revision', '', 0),
(561, 1, '2017-03-07 15:20:22', '2017-03-07 12:20:22', '<h2><img class=\"alignnone size-medium wp-image-474\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1-7-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-475\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/11-7-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-476\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/111-6-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-477\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1111-6-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-478\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/11111-6-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /></h2>\r\n<h2>Турбина «Скиф» ТКР 8.5С1</h2>\r\n&nbsp;\r\n\r\nПроизводительный турбокомпрессор для сельскохозяйственных комбайнов «Колос» КС-6, «Кубань» и «ДОН-1500». Изготовлен на собственных производственных мощностях в Украине. Официальная гарантия на турбину — 12 месяцев.\r\n\r\n<!--more--><!--noteaser-->\r\n\r\n&nbsp;\r\n<h2>Почему фермеры выбирают турбины нашего производства?</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Устойчивость</h3>\r\nНадежные материалы делают данный турбокомпрессор стойким к высоким нагрузкам.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Высокий КПД</h3>\r\nТКР 8.5С1 заметно повышает мощность двигателя комбайна, что увеличивает его продуктивность.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Качество</h3>\r\