(563, 1, '2017-03-07 15:29:02', '2017-03-07 12:29:02', '<h2><img class=\"alignnone size-medium wp-image-490\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3-5-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-491\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33-5-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-492\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/333-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-493\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-494\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33333-5-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-495\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333333-2-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n<h2>Турбина  ТКР 6-00.01</h2>\r\n&nbsp;\r\n\r\nТурбокомпрессор собственного производства для тракторов МТЗ, ЮМЗ, ЛТЗ и ВТЗ. Качество нашей продукции подтверждается необходимыми сертификатами и гарантийным талоном сроком на 1 год. В комплекте гарантия, инструкция и установочные прокладки. Торговым организациям — скидка 10%.\r\n\r\n<!--more-->\r\n\r\n&nbsp;\r\n\r\n<img src=\"https://images.ua.prom.st/489842958_w640_h2048_184623001_w640__8_img_0065.jpg?PIMAGE_ID=489842958\" alt=\"\" />\r\n\r\n&nbsp;\r\n<h2>Почему стоит выбрать турбину «Скиф»?</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Стоимость</h3>\r\nСобственное производство на территории нашей страны позволяет устанавливать лучшие цены на надежные турбокомпрессоры.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Качество</h3>\r\nТурбина изготовлена из качественного металла на современном производстве. Ее надежность подтверждена гарантийными обязательствами.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Производительность</h3>\r\nСовременный турбокомпрессор нашего производства имеет повышенный КПД и существенно улучшает работу двигателя.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Удобство</h3>\r\nВ комплект поставки входит инструкция по установке с комплектом прокладок, которые позволяют самостоятельно установить турбину.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&nbsp;\r\n<h2>Модель: ТКР 6-00.01 , ТКР 6 применяется на следующей технике</h2>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td>Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● Д245.27\r\n● Д245.С-435\r\n● Д245.С-437\r\n● Д245.5\r\n● Д245.5С-439</td>\r\n<td>  ● 600-1118010.01</td>\r\n<td>● МТЗ-922● МТЗ-923\r\n\r\n● ЮМЗ-135\r\n\r\n● ВТЗ, ЛТЗ\r\n\r\n● МТЗ-950\r\n\r\n● МТЗ-952\r\n\r\n● МТЗ-890\r\n\r\n● МТЗ-895</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n<h2>Почему именно мы?</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Производим надежные турбины для вашей техники с 1995 года.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>В случае обнаружения брака, немедленно заменим товар или вернем деньги.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circl