(566, 1, '2017-03-07 16:24:24', '2017-03-07 13:24:24', '<img class=\"alignnone size-medium wp-image-572\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/11-11-199x300.jpg\" alt=\"\" width=\"199\" height=\"300\" />\r\n\r\n<img class=\"alignnone size-medium wp-image-571\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1-11-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" />  <img class=\"alignnone size-medium wp-image-573\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/111-10-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" />\r\n<h2>Турбина  ТКР 11 Н1</h2>\r\n&nbsp;\r\n\r\nВысококачественный, украинский турбокомпрессор для тракторов ХТЗ Т-150Г, Т-150К, Т-157, Т-158; комбайнов «Колос» СК-5, КСК-4, а также для гусеничного трактора ДТ-175С «Волгарь». Выгодные условия для оптовых покупателей и торговых организаций. Гарантия 12 месяцев.\r\n<!--more--><!--noteaser-->\r\n<h2>4 особенности  ТКР 11 Н1</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Материалы высокого качества позволяют выдерживать данной турбине сложные, повышенные нагрузки.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Надежность турбокомпрессора гарантирует стабильную и безостановочную работу вашей техники именно тогда, когда это необходимо.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Благодаря современной сборке, данная модель обладает повышенной эффективностью и увеличивает продуктивность работы сельхоз техники.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Мы изготовили этот турбокомпрессор на собственном, надежном производстве, поэтому можем 