(577, 1, '2017-03-07 16:26:29', '2017-03-07 13:26:29', '<div class=\"b-page__row\">\r\n<div class=\"b-similar-products\">\r\n\r\n<img class=\"alignnone size-medium wp-image-507\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1-8-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-508\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/11-8-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-509\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/111-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-510\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1111-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-511\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/11111-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-512\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/111111-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-513\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1111111-2-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-514\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/11111111-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-515\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1111111111-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" />\r\n\r\n<a class=\"b-similar-products__image-link\" title=\"Актуатор турбокомпрессора серии ТКР 6\" href=\"/p474702070-aktuator-turbokompressora-serii.html\"><img class=\"b-similar-products__image\" src=\"https://images.ua.prom.st/718354954_w200_h200_img_6589.jpg\" alt=\"Актуатор турбокомпрессора серии ТКР 6\" /></a>\r\n<div class=\"b-similar-products__no-image\"></div>\r\n<div class=\"b-similar-products__title\">Актуатор турбокомпрессора серии ТКР 6</div>\r\n</div>\r\n</div>\r\n<div class=\"b-page__row\">\r\n<div class=\"b-online-edit\">\r\n<div class=\"b-user-content\">\r\n<div data-qaid=\"product_description\">\r\n<div>\r\n<h2>Турбина «Скиф» ТКР 6.1-07.01</h2>\r\n&nbsp;\r\n\r\nТурбокомпрессор, изготовленный на собственных производственных мощностях, подходит для грузовых автомобилей МАЗ-4370, ГАЗ-3309, ГАЗ «ВАЛДАЙ», а также для автобуса ПАЗ-32051. Аналог чешской турбины С14-194-01. Гарантия — 1 год. Скидки для оптовых покупателей.\r\n<!--more--><!--noteaser-->\r\n&nbsp;\r\n<h2>Преимущества нашего турбокомпрессора</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Качество</h3>\r\nНаша компания владеет современным производством и использует только высококачественные материалы.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Надежность</h3>\r\nМы тщательно следим за качеством выпускаемой продукции — брак исключен. Несем гарантийные обязательства по турбине сроком 12 месяцев.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Высокий КПД</h3>\r\nТурбокомпрессоры нашего производства способны значительно повышать мощность двигателя вашей техники, увеличивая эффективность ее работы.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Экономия</h3>\r\nМы предлагаем надежные, проверенные клиентами турбокомпрессоры с гарантией качества по лучшим на отечественном рынке ценам.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/489851052_w640_h2048_137150613_w640__632_medium.jpg?PIMAGE_ID=489851052\" /></div>\r\n</div>\r\n&nbsp;\r\n<h2>Модель: ТКР 6.1-07.01 , ТКР 6.1 , ТКР 6 применяется в следующей технике</h2>\r\n<h2></h2>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td>Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● Д245.7-ЕВРО 2\r\n● Д245.9\r\n● Д245.7-566\r\n● Д245.7-165\r\n● Д245.7Е3-1062\r\n● Д245.7Е2-254\r\n● Д245.9-335\r\n● Д245.9-336</td>\r\n<td>  ● 620.1118010.01</td>\r\n<td>● Автобус ПАЗ-32051● Автомобили ГАЗ-3309/33081\r\n\r\n● МАЗ-4370 «Зубренок»\r\n\r\n● ГАЗ - «ВАЛДАЙ»</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Почему стоит выбрать «Agroturbo»?</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Производим турбокомпрессоры с 1995 года. Имеем обширную клиентскую базу.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Доступные цены, скидки для оптовых и постоянных клиентов, а также для торговых организаций и СТО.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Производим возврат денег или обмен товара в случае обнаружения какого-либо брака.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Отправляем турбокомпрессоры по всей стране бесплатно и без предоплаты.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/489858942_w640_h2048_137364875_w640__48_677.750.jpg?PIMAGE_ID=489858942\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n&nbsp;\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online