(578, 1, '2017-03-07 16:27:26', '2017-03-07 13:27:26', '<h2><img class=\"alignnone size-medium wp-image-518\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2-8-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-519\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-520\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/222-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-521\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2222-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-522\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222-6-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" />  <img class=\"alignnone size-medium wp-image-524\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222222-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-525\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222222222-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n<h2>Турбина ТКР 7Н1</h2>\r\n&nbsp;\r\n\r\nНаша компания предлагает надежный, высокоэффективный турбокомпрессор собственного производства для автомобилей КамАЗ. Качество нашей продукции проверено многими автомобилистами со всей страны и подкреплено гарантийным талоном сроком 1 год.\r\n<!--more--><!--noteaser-->\r\n&nbsp;\r\n<h2>4 основных достоинств данного турбокомпрессора</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Выгодная цена на турбину достойного качества благодаря продаже без посредников.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Современные производственные мощности на территории Украины и использование высококачественных материалов.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Наличие сертификатов качества, а также 12 месяцев гарантийного обслуживания клиентов.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Удобный комплект поставки, с инструкцией и прокладками, позволяющий самостоятельно установить турбокомпрессор.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490083991_w640_h2048_137368476_w640__48_700.750.jpg?PIMAGE_ID=490083991\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Модель:  ТКР 7н1 (левый и правый) применяется в следующей технике</h2>\r\n<h2></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td> Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● КамАЗ 7403.10\r\n● КамАЗ 740.11-240</td>\r\n<td>  ● 7403-1118.010</td>\r\n<td>● Автомобили КамАЗ● БТР-80</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Преимущества нашей компании</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Работаем на рынке Украины с 1995 года. Примерно 20% наших заказчиков становятся постоянными клиентами.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Оперативно обрабатываем заявки и отправляем товар благодаря его постоянному наличию на наших складах.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>С нами, у вас есть возможность оплат