(676, 1, '2017-03-07 18:17:07', '2017-03-07 15:17:07', '<img class=\"alignnone size-medium wp-image-539\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1-9-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-540\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/11-9-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-541\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/111-8-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-542\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/1111-8-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-543\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/11111-8-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" />\r\n\r\n&nbsp;\r\n<h2>Турбина ТКР 8.5Н1</h2>\r\n&nbsp;\r\n\r\nНадежный и доступный турбокомпрессор для бульдозеров ДТ-75Н, ПД-22 и ПД-23. Собственное производство позволяет нам гарантировать высокий уровень предлагаемой продукции, самые низкие цены в Украине, а также выгодные условия для сотрудничества с торговыми компаниями.\r\n<!--more--><!--noteaser-->\r\n<h2>Ключевые особенности  ТКР 8.5Н1</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Современный турбокомпрессор в среднем, на 20% более эффективен, чем стандартный, заводской.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Высокое качество материалов, а также ответственное производство гарантирует превосходный готовый результат. Гарантия на турбину — 1 год.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Расположение производственных мощностей на территории Украины позволяет устанавливать адекватные цены на нашу продукцию.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Данный турбокомпрессор весьма устойчив к различным нагрузкам и способен долго и бесперебойно служить.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490092424_w640_h2048_137380435_w640__48_932.750.jpg?PIMAGE_ID=490092424\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Модель: ТКР 8,5Н1 применяется в следующей технике</h2>\r\n<h2></h2>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td>Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● СМД-17Н\r\n● СМД-18Н\r\n● СМД-17Н.05</td>\r\n<td>  ● 851.30001.00-01</td>\r\n<td>  ● Трактор ДТ-75Н\r\n\r\n● ПД-22/23 «Гелиймаш»</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Достоинства компании «Agroturbo»</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>\r\n<h3>Профессионализм</h3>\r\nБолее 20 лет опыта сделали из наших сотрудников настоящих экспертов, которые превосходно разбираются в турбокомпрессорах.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>\r\n<h3>Выгода</h3>\r\nЛучшие на украинском рынке цены, а также гибкие условия сотрудничества для оптовых покупателей и торговых организаций.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>\r\n<h3>Удобство</h3>\r\nПродуманный комплект поставки, надежная упаковка и бесплатная доставка по всей территории Украины.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>\r\n<h3>Безопасность</h3>\r\nВозможность замены или возврата товара после его осмотра, если он вам не подошел или был обнаружен брак.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490093086_w640_h2048_137380450_w640__48_933.750.jpg?PIMAGE_ID=490093086\" /></div>\r\n</div>\r\n<div></div>\r\n<div>\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Оригинал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-2\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">Скиф</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Украина</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-4\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">12(мес)</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Технические характеристика</td>\r\n<td class=\"b-product-info__cell\">ТКР 8,5H1</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диаметр колеса компрессора, мм:</td>\r\n<td class=\"b-product-info__cell\">57/85</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Диаметр колеса турбины, мм:</td>\r\n<td class=\"b-product-info__cell\">62/76</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Частота вращ. вала ротора, об/мин:</td>\r\n<td class=\"b-product-info__cell\">53 000</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Макс степень повыш. давления:</td>\r\n<td class=\"b-product-info__cell\">1,4-1,6</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление наддува, бар:</td>\r\n<td class=\"b-product-info__cell\">0,6</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производительность, кг/с:</td>\r\n<td class=\"b-product-info__cell\">0,13</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Масса, кг:</td>\r\n<td class=\"b-product-info__cell\">9,8</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', 'Турбина ТКР 8,5Н1 / СМД-17Н / СМД-18Н / ДТ-75', '', 'inherit', 'closed', 'closed', '', '538-revision-v1', '', '', '2017-03-07 18:17:07', '2017-03-07 15:17:07', '', 538, 'http://agroturbo-wp/538-revision-v1/', 0, 'revision', '', 0);
