(680, 1, '2017-03-07 18:19:36', '2017-03-07 15:19:36', '<h2>  <img class=\"alignnone size-medium wp-image-499\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/4-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-500\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/44-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-501\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/444-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-502\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/4444-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-503\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/44444-3-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-504\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/44444444-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-495\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333333-2-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-494\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33333-5-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-493\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n<h2>Турбина  ТКР 6-00.02</h2>\r\n&nbsp;\r\n\r\nСовременный турбокомпрессор для автомобилей ЗИЛ 4331 и ЗИЛ 5301, больше известного как «Бычок». Произведен на собственных мощностях, аналог чешской турбины С14-127-01. Официальная гарантия. Скидки для оптовых покупателей и торговых организаций.\r\n\r\n<!--more--><!--noteaser-->\r\n<h2>Некоторые преимущества данной модели</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>