(681, 1, '2017-03-07 18:21:09', '2017-03-07 15:21:09', '<h2><img class=\"alignnone size-medium wp-image-483\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2-7-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\" /> <img class=\"alignnone size-medium wp-image-484\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22-6-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" /> <img class=\"alignnone size-medium wp-image-485\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/222-6-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\" /> <img class=\"alignnone size-medium wp-image-486\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2222-6-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" /></h2>\r\n<h2>Турбина  ТКР 11 Н2</h2>\r\n&nbsp;\r\n\r\nМодель ТКР 11 Н2 — это идеальный вариант для самого массового гусеничного трактора СССР — ДТ-75Н. Кроме того, данная турбина отлично подойдет для комбайнов «НИВА» СК-6, ККС-6 и ККСЦ. Собственное производство позволяет нам гарантировать высокое качество турбокомпрессора, подкрепленное 12 месяцами гарантийных обязательств.\r\n\r\n<!--more--><!--noteaser-->\r\n\r\n&nbsp;\r\n<h2>Особенности турбокомпрессоров производства «Agroturbo»</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Технологичное производственное оборудование и сырье высокого качества позволяют получать турбины отличного уровня.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Благодаря современной сборке, наши турбокомпрессоры отличаются повышенной эффективностью в сравнении с заводскими, стандартными.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Мы ответственно придерживаемся наших обязательств перед клиентами, следим за качеством продукции, выполняем гарантийное обслуживание.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>Изготовление турбин на территории Украины позволяет значительно сэкономить и предлагать продукцию высокого качества по адекватной цене.\r\n\r\n&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490102227_w640_h2048_137399314_w640__48_039_big.jpg?PIMAGE_ID=490102227\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Модель: ТКР 11 Н2 применяется в следующей технике</h2>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Двигатель</td>\r\n<td>Каталожный номер</td>\r\n<td>Техника</td>\r\n</tr>\r\n<tr>\r\n<td>  ● СМД-17Н\r\n● СМД-17КН\r\n● СМД-18Н\r\n● СМД-18КН\r\n● СМД-18МП</td>\r\n<td>  ● 11130001.00</td>\r\n<td>  ● ДТ-75Н\r\n\r\n● Комбайн \"Нива\" СК6\r\n\r\n● Комбайн ККС-6\r\n\r\n● Комбайн ККСЦ</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Почему ТКР 11 Н2 стоит приобрести именно у нас?</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>\r\n<h3>Экономия</h3>\r\nОтсутствие посредников позволяет купить турбины по лучшим ценам на рынке.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>\r\n<h3>Квалификация</h3>\r\nБольшой опыт работы в сфере гарантирует грамотное консультирование по интересующим вас вопросам.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>\r\n<h3>Надежность</h3>\r\nДовольные отзывы от покупателей со всей страны — лучшее подтверждение компетентности нашего персонала.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.pr