<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>\r\n<h3>Удобство</h3>\r\nБесплатная доставка без предоплаты в любой регион Украины.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><img src=\"https://images.ua.prom.st/490102658_w640_h2048_137399330_w640__48_054_big.jpg?PIMAGE_ID=490102658\" /></div>\r\n</div>\r\nВся предложенная продукция имеется в больших объемах на наших складах и уже готова к отправке. Делайте заказ прямо сейчас и вы получите надежный, отечественный турбокомпрессор всего через 1-3 дня!', 'Турбина ТКР 11Н2 / СМД-17 / СМД-18 / «НИВА» СК-6', '', 'publish', 'open', 'open', '', 'turbina-tkr-11n2-smd-17-smd-18-niva-sk-6-2', '', '', '2017-03-07 18:34:59', '2017-03-07 15:34:59', '', 0, 'http://agroturbo-wp/?p=683', 0, 'post', '', 0),
