(711, 1, '2017-03-12 12:27:06', '2017-03-12 09:27:06', '<h2><img class=\"alignnone size-medium wp-image-705\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3-11-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-706\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/33-11-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-707\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/333-9-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-708\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/3333-9-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /></h2>\r\n&nbsp;\r\n<h2>Турбина JP Group GT1544V</h2>\r\n&nbsp;\r\n\r\nТурбина идеально подходит для дизельных корейских автомобилей с объемом двигателя 1.5 литра. Она изготовлена известным европейским производителем автозапчастей, датской компанией JP Group. Использование качественных материалов и технологичное производство обеспечивают превосходные эксплуатационные характеристики турбины, даже при интенсивных нагрузках.\r\n<!--more--><!--noteaser-->\r\n<img src=\"https://images.ua.prom.st/487946038_w640_h2048_115512949_w640_h2048_100.jpg?PIMAGE_ID=487946038\" alt=\"\" />\r\n\r\n&nbsp;\r\n<h2>4 причины установить данный турбокомпрессор на свое авто</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Эффективность</h3>\r\nУстановка турбокомпрессора дает возможность значительно увеличить КПД двигателя, сделав его более продуктивным.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Надежность</h3>\r\nКачественный турбокомпрессор не только улучшает мощность двигателя, но и гарантирует стабильность его работы.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Долговечность</h3>\r\nПродукцию JP Group используют автомобилисты по все Европе. Мы предоставляем гарантию на турбину — 1 год.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Удобство</h3>\r\nВ комплекте поставляется паспорт, инструкция и набор прокладок, которые дают возможность самостоятельно установить турбину.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h3>Модель<strong> </strong>GT1544V​<strong> </strong>применяется в автомобилях</h3>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Модели автомобилей</td>\r\n<td>Каталожный номер</td>\r\n<td>Заводской номер</td>\r\n</tr>\r\n<tr>\r\n<td>  ● Hyundai Getz 1.5 CRDi\r\n● Hyundai Matrix 1.5 CRDi\r\n● Hyundai Matrix 1.5 CRDi VGT\r\n● KIA Cerato 1.5 CRDi\r\n● KIA Cerato 1.6 CRDi\r\n● KIA Rio 1.5 CRDi\r\n● KIA Ceed 1.6 CRDi\r\n● Huyundai Elantra 1.6 CRDi</td>\r\n<td>  ● 782403-5001S\r\n● 740611-5002S\r\n● 740611-5001S\r\n● 740611-5003S\r\n● 740611-0003</td>\r\n<td>  ● 28201-2A110\r\n● 282012A110</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<img src=\"https://images.ua.prom.st/488743874_w640_h2048_343382836_w640__8_img_3281.jpg?PIMAGE_ID=488743874\" alt=\"\" />\r\n\r\n&nbsp;\r\n<h2>«Agroturbo» — эксперт в выборе и ремонте любых турбокомпрессоров!</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Мы предлагаем только качественные турбины от известных брендов.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Доставка в любой регион Украины осуществляется за наш счет.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Опытные консультанты всегда готовы подробно ответить на ваши вопросы.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487947038_w640_h2048_circled_right_2_64_21.png?PIMAGE_ID=487947038\" /></td>\r\n<td>Мы непременно вернем покупателю деньги, если он обнаружит брак.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\nПоспешите прибрести высокоэффективный турбокомпрессор для своего авто по лучшей цене!\r\n\r\n&nbsp;\r\n\r\n<img src=\"https://images.ua.prom.st/326368585_w640_h2048_img_7153.jpg?PIMAGE_ID=326368585\" alt=\"\" />\r\n\r\n<img src=\"https://images.ua.prom.st/326369764_w640_h2048_img_7155_1.jpg?PIMAGE_ID=326369764\" alt=\"\" />\r\n\r\n&nbsp;\r\n\r\n<img src=\"https://images.ua.prom.st/488744774_w640_h2048_343386087_w640__59e98e0b41.jpg?PIMAGE_ID=488744774\" alt=\"\" />\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Марка</td>\r\n<td class=\"b-product-info__cell\">Kia</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Модель</td>\r\n<td class=\"b-product-info__cell\">Cerato</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Серия</td>\r\n<td class=\"b-product-info__cell\">Cerato (LD) 2004-2009</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Легковой автомобиль</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объем двигателя <span id=\"product-attribute-0-4\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">1582.0(куб. см)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Аналог</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-7\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">JP GROUP</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Дания</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-9\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">12(мес)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип топлива</td>\r\n<td class=\"b-product-info__cell\">Дизельное</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Год выпуска</td>\r\n<td class=\"b-product-info__cell\">с 2004 - 2009 (гг.)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Мощность двигателя</td>\r\n<td class=\"b-product-info__cell\">65 / 75 / 81 / 85 kw - 88 / 102 / 110 / 116 (л.с.)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объём двигателя</td>\r\n<td class=\"b-product-info__cell\">1493 см3 / 1582 см - 1.5 L / 1.6 L</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Двигатель</td>\r\n<td class=\"b-product-info__cell\">D4FA / KBA / D4FB / U1.5L Euro 3</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'Турбина KIA Cerato 1.6 CRDi Hyundai Matrix 1.5 CRDi KIA Ceed 1.5 CRDi', '', 'inherit', 'closed', 'closed', '', '704-revision-v1', '', '', '2017-03-12 12:27:06', '2017-03-12 09:27:06', '', 704, 'http://agroturbo-wp/704-revision-v1/', 0, 'revision', '', 0),
