.2 CDI</div></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"b-page__row\">\r\n<div class=\"b-online-edit\">\r\n<div class=\"b-user-content\">\r\n<div data-qaid=\"product_description\">\r\n<div>\r\n<h2>Турбина Garrett GT1852V</h2>\r\n&nbsp;\r\n\r\nВысококачественная, оригинальная турбина французского производства от известного бренда на автомобили Mercedes Sprinter CDI 2000-2006 годов выпуска. Идеальный выбор для замены отжившей свой срок заводской турбины. Поставляется с гарантийным талоном на 12 месяцев.\r\n\r\n&nbsp;\r\n\r\n<img src=\"https://images.ua.prom.st/487946038_w640_h2048_115512949_w640_h2048_100.jpg?PIMAGE_ID=487946038\" alt=\"\" />\r\n\r\n&nbsp;\r\n<h2>Ключевые особенности данной детали</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Качество</h3>\r\nЕвропейское производство обеспечивает надежность и долговечность турбокомпрессора.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Эффективность</h3>\r\nОригинальные, качественные турбины способны значительно повысить мощность двигателя вашего авто.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Надежность</h3>\r\nОфициальная гарантия качества — залог стабильной и длительной работы вашей техники.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Комплектация</h3>\r\nТурбина поставляется вместе с комплектом установочных прокладок, позволяющих установить ее самостоятельно, а также инструкцией, паспортом и гарантией.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&nbsp;\r\n<h3><strong>GARRETT GT1852V / GT18V применяется в автомобилях<