(785, 1, '2017-03-12 14:34:25', '2017-03-12 11:34:25', '<img class=\"alignnone size-medium wp-image-786\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2-15-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-787\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22-14-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /> <img class=\"alignnone size-medium wp-image-788\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/222-14-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-789\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/2222-11-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-790\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/22222-11-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" />\r\n\r\n&nbsp;\r\n\r\n<strong>Турбина </strong>Garrett GT1549S / Opel Movano / Renault Master / Renault Trafic\r\n\r\n<strong>Модель:</strong> ТКР Garrett GT1549S ( Производство Румыния )\r\n\r\n<strong>Каталожный номер:</strong>\r\n•\r\n751768-5004S\r\n\r\n<strong>Заводской номер:  </strong>\r\n•\r\n8200091350A\r\n•\r\n7701472228\r\n\r\n<strong>Автомобиль</strong>:\r\n•\r\nOpel Movano\r\n•\r\nOpel Vivaro\r\n•\r\nRenault Master II\r\n•\r\nRenault Primastar\r\n•\r\nRenault Trafic II\r\n•\r\nVolvo-PKW S40\r\n•\r\nVolvo-PKW V40\r\n•\r\nRenault Laguna II\r\n\r\n<strong>Двигатель</strong>: F9Q\r\n\r\n<strong>Мощность</strong>: 100-102 л.с.\r\n\r\n<strong>Год выпуска</strong>: с 2000-\r\n<!--more--><!--noteaser-->\r\n\r\n&nbsp;\r\n<h2>Турбина Garrett GT1549S</h2>\r\n&nbsp;\r\n\r\nКачественный турбокомпрессор французского производства от известной американской компании. Подходит для установки на автомобили Opel Movano, Opel Vivaro, Renault Master II, Renault Trafic II, Volvo S40 и Volvo V40 с двигателями 1.9 DCI. Гарантийный срок — 12 месяцев.\r\n\r\n&nbsp;\r\n\r\n<img src=\"https://images.ua.prom.st/487946038_w640_h2048_115512949_w640_h2048_100.jpg?PIMAGE_ID=487946038\" alt=\"\" />\r\n\r\n&nbsp;\r\n<h2>Преимущества турбины Garrett GT1549S</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Универсальность</h3>\r\nТурбокомпрессор GT1549S устанавливается на множество автомобилей с дизельным двигателем объемом 1.9 литра.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Оригинальность</h3>\r\nВысококачественное французское производство гарантирует значительно более долгий срок службы в сравнении с дешевыми аналогами.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Надежность</h3>\r\nМы предлагаем официальную гарантию на данную турбину сроком 1 год, поэтому вы можете быть уверены в ее качестве.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Эффективность</h3>\r\nТурбокомпрессор Garrett значительно повышает КПД двигателя, стабильно обеспечивая его высокую производительность.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&nbsp;\r\n<h2>Модель: ТКР Garrett GT1549S​ применяется в автомобилях</h2>\r\n<h2></h2>\r\n<h2></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Модели автомобилей</td>\r\n<td>Каталожный номер</td>\r\n<td>Заводской номер</td>\r\n</tr>\r\n<tr>\r\n<td>  ● Opel Movano\r\n● Opel Vivaro\r\n● Renault Master II\r\n● Renault Primastar\r\n● Renault Trafic II\r\n● Volvo-PKW S40\r\n● Volvo-PKW V40\r\n● Renault Laguna II</td>\r\n<td>  ● 751768-5004S\r\n● 751768-5003S\r\n● 751768-0001\r\n● 751768-0002\r\n● 717345-0002\r\n● 703245-0001/2\r\n● 5303 988 0048\r\n● 703245-0001\r\n● 703245-0002\r\n● 703245-5001S\r\n