(810, 1, '2017-03-12 15:06:09', '2017-03-12 12:06:09', '<img class=\"alignnone size-medium wp-image-801\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/4-8-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-802\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/44-8-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-803\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/444-9-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-804\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/4444-7-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-805\" src=\"http://agroturbo-wp/wp-content/uploads/2017/03/444444-4-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" />\r\n\r\n<strong>Турбина</strong> ТКР \"KKK\" KP-35 / Renault Kangoo / Renault Clio / K9K-700\r\n\r\n<strong>Модель</strong>: ТКР KKK KP35\r\n\r\n<strong>Заводской номер: </strong>\r\n8200409037\r\n7701473122\r\n\r\n<strong>Оригинальный номер:  </strong>\r\n54359880000\r\n\r\n<strong>Автомобиль:</strong>\r\n•\r\nRenault Kangoo I\r\n•\r\nRenault Clio II\r\n•\r\nDacia Logan\r\n•\r\nNissan Almera 1.5 dCi\r\n•\r\nNissan Micra 1.5 dCi\r\n•\r\nRenault Clio II 1.5 dCi\r\n•\r\nRenault Megane II 1.5 dCi\r\n\r\n● Nissan Kubistar 1.5 dci\r\n\r\n<strong>Двигатель: </strong>K9K-700 / K9K-260 / K9K-702\r\n\r\n<strong>Мощность: </strong>57-65 л.с. 80 ― 82 л.с.\r\n\r\n<strong>Год выпуска:</strong> 2000-\r\n\r\n&nbsp;\r\n<!--more--><!--noteaser-->\r\n<h2></h2>\r\n&nbsp;\r\n<h2>Турбина KKK KP35</h2>\r\nНадежная немецкая турбина для Renault Kangoo I, Renault Clio II, Dacia Logan, Nissan Micra, Nissan Almeria и подобным автомобилям с двигателями 1.5 DCI 2000-2006 годов выпуска. Официальная гарантия — 12 месяцев. Поставляется с инструкцией и комплектом установочных прокладок.\r\n\r\n&nbsp;\r\n\r\n<img src=\"https://images.ua.prom.st/487946038_w640_h2048_115512949_w640_h2048_100.jpg?PIMAGE_ID=487946038\" alt=\"\" />\r\n\r\n&nbsp;\r\n<h2>Несколько преимуществ KP35</h2>\r\n<div>\r\n<div>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Надежность</h3>\r\n3K — известный немецкий производитель турбокомпрессоров, который завоевал доверие таких гигантов, как Volkswagen, Audi, Citroen и Seat.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Универсальность</h3>\r\nДанная модель подходит для самых разных дизельных авто с объемом двигателя 1.5 литра.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Продуктивность</h3>\r\nОригинальная турбина немецкого производителя значительно повысит производительность вашего автомобиля.</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/487945056_w640_h2048_checked_64_12.png?PIMAGE_ID=487945056\" /></td>\r\n<td>\r\n<h3>Долговечность</h3>\r\nИспользование высококачественных материалов гарантирует долгий срок эксплуатации такого турбокомпрессора.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&nbsp;\r\n<h2></h2>\r\n<h2>Модель: KKK KP35​ применяется в автомобилях</h2>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Модели автомобилей</td>\r\n<td>Заводской номер</td>\r\n<td>Оригинальный номер</td>\r\n</tr>\r\n<tr>\r\n<td>  ● Renault Kangoo I\r\n● Renault Clio II\r\n● Dacia Logan\r\n● Nissan Almera 1.5 dCi\r\n● Nissan Micra 1.5 dCi\r\n● Renault Clio II 1.5 dCi\r\n● Renault Megane II 1.5 dCi\r\n● Nissan Kubistar 1.5 dci</td>\r\n<td>  ● 8200022735\r\n● 8200351439\r\n● 8200409030\r\n● 8200119854\r\n● 8200189536\r\n● 8200351471\r\n● 8200409037\r\n● 7701473122\r\n● 7701473673\r\n● 7711135039</td>\r\n<td>  ● 54359880000\r\n● 54359700000\r\n● 54359880002\r\n● 54359700002</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Легковой автомобиль</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-1\" class=\"b-icon-help \"> </span></td>\r\n<td class=\"b-product-info__cell\">KKK</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Германия</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Год выпуска</td>\r\n<td class=\"b-product-info__cell\">2000-2006 (гг.)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Мощность</td>\r\n<td class=\"b-product-info__cell\">57 / 65 / 80 (л.с.)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Двигатель</td>\r\n<td class=\"b-product-info__cell\">K9K / K9K-700 / K9K-702</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок</td>\r\n<td class=\"b-product-info__cell\">12 мес</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Марка</td>\r\n<td class=\"b-product-info__cell\">Renault</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Оригинал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Модель</td>\r\n<td class=\"b-product-info__cell\">Kangoo</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление турбины</td>\r\n<td class=\"b-product-info__cell\">5 бар</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объем двигателя</td>\r\n<td class=\"b-product-