cell\">CX-7</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Серия</td>\r\n<td class=\"b-product-info__cell\">CX-7 (ER) 2006-</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление турбины</td>\r\n<td class=\"b-product-info__cell\">1 (бар)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Легковой автомобиль</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объем двигателя <span id=\"product-attribute-0-5\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">2261.0 (куб. см)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Аналог</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-8\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">JP GROUP</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Дания</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-10\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">12 (мес)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип топлива</td>\r\n<td class=\"b-product-info__cell\">Бензин</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'ТУРБИНА MAZDA CX-7 / 2.3 TFSI', '', 'inherit', 'closed', 'closed', '', '930-revision-v1', '', '', '2021-01-04 19:20:18', '2021-01-04 16:20:18', '', 930, 'http://agroturbo-wp/930-revision-v1/', 0, 'revision', '', 0),
