"_blank\" rel=\"noopener\">Турбина</a> преобразовывает тепловую энергию в механическую. Данная модель работает на бензине.\r\n<h2>Описание модели</h2>\r\n<ul>\r\n 	<li>Деталь предназначена для автомобилей Mazda CX-7 MZR DISI.</li>\r\n 	<li>Деталь аналоговая, полностью взаимозаменяема с оригинальной.</li>\r\n 	<li>Высочайшее качество изготовления, официальная гарантия качества.</li>\r\n</ul>\r\n<h2>Преимущества сотрудничества с «Скиф-Турбо»</h2>\r\n<ul>\r\n 	<li>Являемся производителями и дилерами от заводов-изготовителей.</li>\r\n 	<li>Лояльные цены за счет прямого сотрудничества, отсутствие наценок посредников.</li>\r\n 	<li>Большой выбор товаров — запчасти для турбокомпрессоров для любой техники.</li>\r\n 	<li>Бесплатная доставка по Украине, оперативная обработка заказа.</li>\r\n</ul>\r\nМы гарантируем качество товара, а при наличие брака — на 100% возвращаем деньги. Предлагаем квалифицированную консультацию от специалистов.\r\nЗаводской номер: K0422-882\r\nКаталожный номер:  L3M713700C , L3M713700D , L3Y4-13-70Z\r\nДвигатель: DISI EU\r\nМощность двигателя: 260 лошадиных сил\r\nОбъём двигателя: 2261 см3 либо 2.3 L\r\nГод выпуска: с 2005 ― 2008 г.\r\n<!--more--><!--noteaser-->\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Марка</td>\r\n<td class=\"b-product-info__cell\">Mazda</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Модель</td>\r\n<td class=\"b-product-info__cell\">CX-7</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Серия</td>\r\n<td class=\"b-product-info__cell\">CX-7 (ER) 2006-</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление турбины</td>\r\n<td class=\"b-product-info__cell\">1 (бар)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Легковой автомобиль</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объем двигателя <span id=\"product-attribute-0-5\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">2261.0 (куб. см)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Аналог</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-8\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">JP GROUP</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Дания</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-10\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">12 (мес)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип топлива</td>\r\n<td class=\"b-product-info__cell\">Бензин</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'ТУРБИНА MAZDA CX-7 / 2.3 TFSI', '', 'inherit', 'closed', 'closed', '', '930-revision-v1', '', '', '2021-01-04 19:25:19', '2021-01-04 16:25:19', '', 930, 'http://agroturbo-wp/930-revision-v1/', 0, 'revision', '', 0),
