ssory-dlya-legkovyh\" target=\"_blank\" rel=\"noopener\">Турбина</a> данной модели выпускается датской компанией JP GROUP, полностью соответствует европейским стандартам качества. Турбина работает с дизельным двигателем. Предназначена для двигателей объемом 2.5 L.\r\n\r\n&nbsp;\r\n<h2>Описание модели</h2>\r\n&nbsp;\r\n<ul>\r\n 	<li>Предназначена для легковых автомобилей Volkswagen Touareg.</li>\r\n 	<li>Деталь является аналоговой, но полностью заменяет оригинал.</li>\r\n 	<li>Высокое качество изготовление, долговечность.</li>\r\n 	<li>Официальная гарантия качества в течение 1 года.</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Преимущества сотрудничества с «Скиф-Турбо»</h2>\r\n&nbsp;\r\n<ul>\r\n 	<li>Предлагаем товары напрямую от заводов-изготовителей.</li>\r\n 	<li>Являемся производителями с собственной мастерской для ремонта турбокомпрессоров.</li>\r\n 	<li>Запчасти для турбокомпрессоров для любой техники (авто, тракторы, морская техника).</li>\r\n 	<li>Доступные цены за счет отсутствия наценок посредников.</li>\r\n</ul>\r\nОтправка по Украине выполняется за наш счет — вы не платите за доставку! Заказ отправляется вам в день покупки или на следующий. С нами удобно!\r\n\r\n&nbsp;\r\n\r\nОригинальный номер:\r\n<ul>\r\n 	<li>716885-5004S</li>\r\n 	<li>716885-9005S</li>\r\n 	<li>716885-0004</li>\r\n 	<li>716885-0003</li>\r\n 	<li>716885-0002</li>\r\n 	<li>716885-0001</li>\r\n</ul>\r\nЗаводской номер:\r\n<ul>\r\n 	<li>070145701J</li>\r\n 	<li>070145701JV</li>\r\n 	<li>070145701JX</li>\r\n 	<li>070145702B</li>\r\n 	<li>070145702BV</li>\r\n 	<li>070145702BX</li>\r\n</ul>\r\nАвтомобиль: Volkswagen Touareg 2.5 TDI\r\n\r\nДвигатель: BAC / BLK\r\n\r\nОбъем двигателя: 2460 см3 / 2.5 L\r\n\r\nМощность двигателя: 128 kw / 174 л.с.\r\n\r\nГод выпуска: с января 2003 ― гг.\r\n\r\n<!--more--><!--noteaser-->\r\n\r\n<span class=\"b-product__title\">Характеристики</span>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Марка</td>\r\n<td class=\"b-product-info__cell\">Volkswagen</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Модель</td>\r\n<td class=\"b-product-info__cell\">Touareg</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Серия</td>\r\n<td class=\"b-product-info__cell\">TOUAREG (7LA, 7L6, 7L7) 2002-2010</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление турбины</td>\r\n<td class=\"b-product-info__cell\">2 (бар)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Легковой автомобиль</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объем двигателя <span id=\"product-attribute-0-5\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">2460.0 (куб. см)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Аналог</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Состояние</td>\r\n<td class=\"b-product-info__cell\">Новое</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-8\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">JP GROUP</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Дания</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок <span id=\"product-attribute-0-10\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">12 (мес)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип топлива</td>\r\n<td class=\"b-product-info__cell\">Дизельное</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'ТУРБИНА VOLKSWAGEN TOUAREG 2.5 TDI / GT2056V', '', 'inherit', 'closed', 'closed', '', '955-revision-v1', '', '', '2021-01-04 19:35:20', '2021-01-04 16:35:20', '', 955, 'http://agroturbo-wp/955-revision-v