(993, 1, '2021-01-04 19:50:39', '2021-01-04 16:50:39', '<img class=\"alignnone size-medium wp-image-983\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328864498_w640_h640_328864498-2-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-984\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328864783_w640_h640_328864783-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-985\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328865042_w640_h640_328865042-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-986\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328865242_w640_h640_328865242-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-987\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328865562_w640_h640_328865562-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-988\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328865778_w640_h640_328865778-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-989\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328866098_w640_h640_328866098-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-990\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328866205_w640_h640_328866205-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-991\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328867402_w640_h640_328867402-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" /> <img class=\"alignnone size-medium wp-image-992\" src=\"http://agroturbo-wp/wp-content/uploads/2021/01/328867517_w640_h640_328867517-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" />\r\n\r\n<strong>Модели автомобилей:</strong>\r\n● Renault Kangoo I\r\n● Renault Clio II\r\n● Dacia Logan\r\n● Nissan Almera 1.5 dCi\r\n● Nissan Micra 1.5 dCi\r\n● Renault Clio II 1.5 dCi\r\n● Renault Megane II 1.5 dCi\r\n● Nissan Kubistar 1.5 dci\r\n<strong>Заводской номер:</strong>\r\n● 8200022735\r\n● 8200351439\r\n● 8200409030\r\n● 8200119854\r\n● 8200189536\r\n● 8200351471\r\n● 8200409037\r\n● 7701473122\r\n● 7701473673\r\n● 7711135039\r\n<strong>Оригинальный номер:</strong>\r\n● 54359880000\r\n● 54359700000\r\n● 54359880002\r\n● 54359700002\r\n<!--more--><!--noteaser-->\r\n<h3><span class=\"b-product__title\">Характеристики</span></h3>\r\n<div class=\"b-online-edit\">\r\n<table class=\"b-product-info\">\r\n<tbody>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Основные</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Марка</td>\r\n<td class=\"b-product-info__cell\">Renault</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Модель</td>\r\n<td class=\"b-product-info__cell\">Kangoo</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Производитель <span id=\"product-attribute-0-2\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">JP GROUP</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Объем двигателя <span id=\"product-attribute-0-3\" class=\"icon-help\"> </span></td>\r\n<td class=\"b-product-info__cell\">1460 куб. см куб. см</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Страна производитель</td>\r\n<td class=\"b-product-info__cell\">Дания</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип техники</td>\r\n<td class=\"b-product-info__cell\">Легковой автомобиль</td>\r\n</tr>\r\n<tr>\r\n<th class=\"b-product-info__header\" colspan=\"2\">Дополнительные характеристики</th>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Гарантийный срок</td>\r\n<td class=\"b-product-info__cell\">12</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Тип запчасти</td>\r\n<td class=\"b-product-info__cell\">Не оригинал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление турбины</td>\r\n<td class=\"b-product-info__cell\">5</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Мощность</td>\r\n<td class=\"b-product-info__cell\">57 / 65 / 80 (л.с.) степень повыш. давления 2</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Двигатель</td>\r\n<td class=\"b-product-info__cell\">K9K / K9K-700 / K9K-702</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Год выпуска</td>\r\n<td class=\"b-product-info__cell\">2000-2006 (гг.)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h3></h3>\r\n<h3><strong>Принцип работы турбины </strong>4317400600</h3>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/328866554_328866554.jpg?PIMAGE_ID=328866554\" alt=\"\" /></td>\r\n<td></td>\r\n<td>Принцип работы турбокомпрессора прост: через выпускной коллектор отработанные газы попадают в корпус турбины в которой установлено турбинное колесо, которое приводится в движение. На одной оси с турбинным колесом установлено компрессорное колесо, которое в свою очередь сжимает воздух и падет его в впускной коллектор двигателя. Из всего этого следует, что обороты турбины очень высоки и напрямую зависят от мощности двигателя, скорость вращение турбины достигает 150.000 об/мин и более.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\"></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\">При использовании турбины, в двигатель поступает воздух под высоким давлением, что позволяет увеличиться мощности автомобиля по отношению к объему двигателя и количеству топлива.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/328866811_328866811.jpg?PIMAGE_ID=328866811\" alt=\"\" /></td>\r\n<td></td>\r\n<td>Наиболее эффективными являются турбокомпрессоры высокого давления. Отличие в конструкции от обычных турбин в том, что турбины повышенного давления имеют клапан, который устраняет избыточное давление на высоких оборотах.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Так же большинство турбокомпрессоров оснащены интеркулером. Основная задача интеркулера – охлаждение воздуха. Так как турбина работает на больших оборотах, воздух в ней нагревается, тем самым понижается содержание кислорода и плотность воздуха.</td>\r\n<td><img src=\"https://images.ua.prom.st/328867075_328867075.jpg?PIMAGE_ID=328867075\" alt=\"\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h3><strong>Существуют 3 основные причины выхода турбины из строя</strong></h3>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/328867254_328867254.jpg?PIMAGE_ID=328867254\" alt=\"\" /></td>\r\n<td></td>\r\n<td>• Грязный (не фильтрованный) воздух, проходя через компрессорное колесо изнашивает лопатки и турбина разбалансирована – повышенные вибрации в процессе работы и ротор ломается.\r\n\r\n&nbsp;\r\n\r\n• Масло, на котором Вы эксплуатируете автомобиль – самая большая проблема в турбине т.к. масло должно быть не только оригинальным, но и соответствовать допускам фирм-изготовителей автомобилей.\r\n\r\n&nbsp;\r\n\r\n• Качественное топливо и дозировка его в цилиндры т.к. несгораемое топливо догорает в процессе выхлопа и оплавляет лопатки турбины.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\nТурбо Маркет «СКИФ-ТУРБО», является прямым диллером, Мелитопольского завода турбокомпрессоров «СКИФ-ТУРБО», и готов предложить Вам огромный выбор всех типов турбин, для с\\х и автомобильной промышленности. Турбины для всех типов двигателей – качество проверенное временем!', 'ТУРБИНА RENAULT KANGOO 1.5 DCI - JP GROUP', '', 'inherit', 'closed', 'closed', '', '971-revision-v1', '', '', '2021-01-04 19:50:39', '2021-01-04 16:50:39', '', 971, 'http://agroturbo-wp/971-revision-v1/', 0, 'revision', '', 0),
