инал</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Давление турбины</td>\r\n<td class=\"b-product-info__cell\">5</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Мощность</td>\r\n<td class=\"b-product-info__cell\">57 / 65 / 80 (л.с.) степень повыш. давления 2</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Двигатель</td>\r\n<td class=\"b-product-info__cell\">K9K / K9K-700 / K9K-702</td>\r\n</tr>\r\n<tr>\r\n<td class=\"b-product-info__cell\">Год выпуска</td>\r\n<td class=\"b-product-info__cell\">2000-2006 (гг.)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h3></h3>\r\n<h3><strong>Принцип работы турбины </strong>4317400600</h3>\r\n&nbsp;\r\n<table class=\"no-borders\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/328866554_328866554.jpg?PIMAGE_ID=328866554\" alt=\"\" /></td>\r\n<td></td>\r\n<td>Принцип работы турбокомпрессора прост: через выпускной коллектор отработанные газы попадают в корпус турбины в которой установлено турбинное колесо, которое приводится в движение. На одной оси с турбинным колесом установлено компрессорное колесо, которое в свою очередь сжимает воздух и падет его в впускной коллектор двигателя. Из всего этого следует, что обороты турбины очень высоки и напрямую зависят от мощности двигателя, скорость вращение турбины достигает 150.000 об/мин и более.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\"></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\">При использовании турбины, в двигатель поступает воздух под высоким давлением, что позволяет увеличиться мощности автомобиля по отношению к объему двигателя и количеству топлива.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/328866811_328866811.jpg?PIMAGE_ID=328866811\" alt=\"\" /></td>\r\n<td></td>\r\n<td>Наиболее эффективными являются турбокомпрессоры высокого давления. Отличие в конструкции от обычных турбин в том, что турбины повышенного давления имеют клапан, который устраняет избыточное давление на высоких оборотах.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Так же большинство турбокомпрессоров оснащены интеркулером. Основная задача интеркулера – охлаждение воздуха. Так как турбина работает на больших оборотах, воздух в ней нагревается, тем самым понижается содержание кислорода и плотность воздуха.</td>\r\n<td><img src=\"https://images.ua.prom.st/328867075_328867075.jpg?PIMAGE_ID=328867075\" alt=\"\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h3><strong>Существуют 3 основные причины выхода турбины из строя</strong></h3>\r\n&nbsp;\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><img src=\"https://images.ua.prom.st/328867254_328867254.jpg?PIMAGE_ID=328867254\" alt=\"\" /></td>\r\n<td></td>\r\n<td>• Грязный (не фильтрованный) воздух, проходя через компрессорное колесо изнашивает лопатки и турбина разбалансирована – повышенные вибрации в процессе работы и ротор ломается.\r\n\r\n&nbsp;\r\n\r\n• Масло, на котором Вы эксплуатируете автомобиль – самая большая проблема в турбине т.к. масло должно быть не только оригинальным, но и соответствовать допускам фирм-изготовителей автомобилей.\r\n\r\n&nbsp;\r\n\r\n• Качественное топливо и дозировка его в цилиндры т.к. несгораемое топливо догорает в процессе выхлопа и оплавляет лопатки турбины.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\nТурбо Маркет «СКИФ-ТУРБО», является прямым диллером, Мелитопольского завода турбокомпрессоров «СКИФ-ТУРБО», и готов предложить Вам огромный выбор всех типов турбин, для с\\х и автомобильной промышленности. Турбины для всех типов двигателей – качество проверенное временем!', 'ТУРБИНА RENAULT KANGOO 1.5 DCI - JP GROUP', '', 'inherit', 'closed', 'closed', '', '971-revision-v1', '', '', '2021-01-04 19:52:01', '2021-01-04 16:52:01', '', 971, 'http://agroturbo-wp/971-revision-v1/', 0, 'revision', '', 0),
